string = ""
chr_list = []
for i in range(len(string)):
    if i % 2 == 0:
        print(string[:7])
        chr_list.append(chr(int(string[:7],2)))
        string = string[7:]
    else:
        print(string[:8])
        chr_list.append(chr(int(string[:8],2)))
        string = string[8:]
print("Output: "+"".join(chr_list))
